import React from 'react';
import './App.css';

function ToDo(){
    
        return(
            <div className="do-items">
                <input type="checkbox" checked={props.item.completed} onChange={()=>props.handleChange(props.item.id)}/>
                <p>{this.props.item.text}</p>
            </div>
        )
}
    


export default ToDo;














